    "labrador": { jp: "„É©„Éñ„É©„Éâ„Éº„É´„Éª„É¨„Éà„É™„Éê„Éº", desc: "ÈùûÂ∏∏„Å´Ë≥¢„Åè„ÄÅÂÆ∂Â∫≠Áä¨„ÇÑÁõ≤Â∞éÁä¨„Å®„Åó„Å¶„ÇÇ‰∫∫Ê∞ó„Åå„ÅÇ„Çä„Åæ„Åô„ÄÇ" },
