    } else if (answers[0] === "„ÅØ„ÅÑ" && answers[1] === "„ÅØ„ÅÑ" && answers[2] === "„ÅÑ„ÅÑ„Åà") {
      return { en: "corgi", ...breedMapping["corgi"] };
    } else if (answers[0] === "„ÅØ„ÅÑ" && answers[1] === "„ÅÑ„ÅÑ„Åà" && answers[2] === "„ÅØ„ÅÑ") {
