    } else if (answers[0] === "„ÅØ„ÅÑ" && answers[1] === "„ÅÑ„ÅÑ„Åà" && answers[2] === "„ÅÑ„ÅÑ„Åà") {
      return { en: "frenchbulldog", ...breedMapping["frenchbulldog"] };
    } else if (answers[0] === "„ÅÑ„ÅÑ„Åà" && answers[1] === "„ÅØ„ÅÑ" && answers[2] === "„ÅØ„ÅÑ") {
      return { en: "dachshund", ...breedMapping["dachshund"] };
    } else if (answers[0] === "„ÅÑ„ÅÑ„Åà" && answers[1] === "„ÅÑ„ÅÑ„Åà" && answers[2] === "„ÅØ„ÅÑ") {
      return { en: "labrador", ...breedMapping["labrador"] };
    } else {
      return { en: "pug", ...breedMapping["pug"] };
    }
  };  

  const handleAnswer = (answer) => {
    const updatedAnswers = [...answers, answer];
    setAnswers(updatedAnswers);
    // Ë≥™ÂïèÁµÇ‰∫ÜÂàÜÂ≤êÂàÜÂ≤ê
    if (currentQuestion < questions.length - 1) {
      setCurrentQuestion(currentQuestion + 1);
    } else {
      const breed = determineBreed(updatedAnswers);
      setSelectedBreed(breed);
    }
  };

  return (
    <div className="container">
      <h1 className="mt-4 text-primary">„ÅÇ„ÅÆÁä¨„ÅÆÁ®ÆÈ°û„ÅØÔºüüêï</h1>
      {selectedBreed ? (
        <Result breed={selectedBreed} />
      ) : (
        <Question
          question={questions[currentQuestion].question}
          options={questions[currentQuestion].options}
          onAnswer={handleAnswer}
        />
      )}
    </div>
  );
}

